import {useParams} from "react-router-dom";
import { useEffect } from "react";
function Item() {

    let { item } = useParams();
    useEffect(()=>{
        console.log(item)}, [])
    return (
        <div className="Item">
            This item
        </div>
    );
}

export default Item;
